import axios from 'axios'

export default () => {
  axios.get('https://www.arnoldclark.com/used-cars/search.json?payment_type=monthly&min_price=100&max_price=150&sort_order=monthly_payment_up')
  .then(function (response) {
    console.log(response);
  })
  .catch(function (error) {
    console.log(error);
  });
};
